import React from "react";
import "./Page1.css";

const SplitWindow = () => {
  return (
    <div className="container">
      {/* Côté gauche */}
      <div className="left-pane">
        <img
          src="./images/recycle-bin.png"
          alt="Gauche"
          className="img-gauche"
        />
      </div>

      {/* Côté droit */}
      <div className="right-pane">
        <img
          src="./images/logo.png"
          alt="Droite"
          className="img-droite"
        />
      </div>
    </div>
  );
};

export default SplitWindow;
